      }
      if (y > limitY) {
        possible = false;
      }
      if (possible) {
        move();
      }
    }
    // BOTTOM CHECK
    if (x > previousX && y == previousY) {
      for (let i = previousX + 1; i <= x; i++) {
        if (isWhite(currentBoard[i][y]) == true) {
          limitX = i;
          break;
        }
        if (isWhite(currentBoard[i][y]) == false) {
          possible = false;
          break;
        }
      }
      if (x > limitX) {
        possible = false;
      }
      if (possible) {
        move();
      }
    }
    // LEFT UP CHECK
    if (
      x < previousX &&
      y < previousY &&
      x + diff == previousX &&
      y + diff == previousY
    ) {
      for (let i = 1; i <= diff; i++) {
        if (isWhite(currentBoard[previousX - i][previousY - i]) == true) {
          limit = i;
          break;
        }
        if (isWhite(currentBoard[previousX - i][previousY - i]) == false) {
          possible = false;
          break;
        }
      }
      if (diff != limit && limit) {
        possible = false;
      }
      if (possible) {
        move();
      }
    }

    // RIGHT UP CHECK

    if (
      x < previousX &&
      y > previousY &&
      x + diff == previousX &&
      y - diff == previousY
    ) {
      for (let i = 1; i <= diff; i++) {
        if (isWhite(currentBoard[previousX - i][previousY + i]) == true) {
          limit = i;
          break;
        }
        if (isWhite(currentBoard[previousX - i][previousY + i]) == false) {
          possible = false;
          break;
        }
      }
      if (diff != limit && limit) {
        possible = false;
      }

      if (possible) {
        move();
      }
    }

    // BOTTOM RIGHT CHECK
    if (
      x > previousX &&
      y > previousY &&
      x + diff == previousX &&
      y + diff == previousY
    ) {
      diff = -diff;
      for (let i = 1; i <= diff; i++) {
        if (isWhite(currentBoard[previousX + i][previousY + i]) == true) {
          limit = i;
          break;
        }
        if (isWhite(currentBoard[previousX + i][previousY + i]) == false) {
          possible = false;
          break;
        }
      }
      if (diff != limit && limit) {
        possible = false;
      }

      if (possible) {
        move();
      }
    }
    // BOTTOM LEFT CHECK
    if (
      x > previousX &&
      y < previousY &&
      x + diff == previousX &&
      y - diff == previousY
    ) {
      diff = -diff;
      for (let i = 1; i <= diff; i++) {
        if (isWhite(currentBoard[previousX + i][previousY - i]) == true) {
          limit = i;
          break;
        }
        if (isWhite(currentBoard[previousX + i][previousY - i]) == false) {
          possible = false;
          break;
        }
      }
      if (diff != limit && limit) {
        possible = false;
      }
      if (possible) {
        move();
      }
    }
  }
  function moveBlackKing(html, pons, x, y, previousX, previousY) {
    const move = () => {
      updatePons("black", pons, x, y, previousX, previousY);
      removeWhite(html);
    };

    if (
      isWhite(currentBoard[x][y]) == true ||
      isWhite(currentBoard[x][y]) == null
    ) {
      if ((x - 1 == previousX || x + 1 == previousX) && y == previousY) {
        move();
      } else if ((y - 1 == previousY || y + 1 == previousY) && x == previousX) {
        move();
      }
      // TOP LEFT CHECK
      else if (x + 1 == previousX && y + 1 == previousY) {
        move();
      } else if (x - 1 == previousX && y - 1 == previousY) {
        move();
      } else if (x - 1 == previousX && y + 1 == previousY) {
        move();
      } else if (x + 1 == previousX && y - 1 == previousY) {
        move();
      }
    }
  }
